import React from 'react';
import todoData from './todosData'
import TodoItem from './components/TodoItem'

class App extends React.Component {
  constructor() {
    super()
    this.state = {
      todos: todoData
    }
  }
  render() {
    const todoItem = this.state.todos.map(item => {
      return (
        <TodoItem todo={item} />
      )
    })
    return (
      <div>
        <h1>Todo List:</h1>
        {todoItem}
      </div>
    )
  }
}

export default App;
